import {BrowserRouter as Router,  Switch, Route} from "react-router-dom"
import index_Home from "./page/index_Home"
import Profile from "./page/Profile"




function App() {
  return (
    <div className="App">
      <Router>
          <Switch>
              <Route path="/" exact component={index_Home}/>
              <Route path="/Profile" component={Profile}/>
       
            
          </Switch>
      </Router>
    </div>
  );
}

export default App;
